var blocLevels = document.querySelector('.categories-block');
var sectionGuess = document.querySelector('.guess');
var sectionSelect = document.querySelector('.select');
var button = document.querySelector('.play__button_next');
var wrapper = document.querySelector('.play__wrapper');
var textScore = document.querySelector('.score');
var main = document.querySelector('.play');

function showResults(score) {
  textScore.style.display = 'none';
  blocLevels.style.display = 'none';
  sectionGuess.style.display = 'none';
  sectionSelect.style.display = 'none';
  wrapper.classList.add('results__wrapper');

  if (score === 30) {
    button.style.display = 'none';
  }

  var resultBlock = document.createElement('div');
  var resultText = document.createElement('p');
  var resultImg = document.createElement('span');

  if (score === 30) {
    resultText.textContent = "Fantastic result! You guessed it all!";
  } else {
    resultText.textContent = "Your score: ".concat(score);
  }

  resultBlock.append(resultText);
  resultBlock.append(resultImg);
  resultBlock.classList.add('results-block');
  resultText.classList.add('text-results');
  resultImg.classList.add('img-results');
  main.prepend(resultBlock);
  button.textContent = 'Play again!';
  button.classList.add('play_again');
}

